import axios from "axios";

export const getFiles = () => {
  return (
    axios.create({
      headers: {
        Authorization: "Bearer " + process.env.TOKEN,
        "Content-Type": "application/json"
      },
      baseURL: process.env.SERVER_NAME,
    }).get(`/files`)
      .then((res) => res.data)
      .catch((error) => { throw error })
  )
};
